import React, { Component } from 'react';


const AppContainerStyles = {
  backgroundImage: './images/prism/prism.png'
}

class App extends Component {
  render() {
    return (
      <div className="app_container" style={AppContainerStyles}>
        <h1>Tricky Clicks!</h1>
      </div>
    );
  }
}

export default App;
